import React from 'react';

function Table(props) {
    const allUsers = () => {
        let allUsersData = [];
        let tableUsers = [];
        try{
			if(window.localStorage.getItem('users'))
				allUsersData = window.localStorage.getItem('users');
			if(allUsersData.length && typeof allUsersData !== 'undefined')
				allUsersData = JSON.parse(allUsersData);
		}
		catch(e){
			console.log("CAUGHT ERROR:Table", e);
		}

        if(allUsersData.length)
        {
            tableUsers =  allUsersData.map((ele, index)=>{
                return (<div>
                    <p>{ele.fname} - {ele.lname}</p>
                </div>)
            })
        }

        if(tableUsers)
            return (<div>{tableUsers}</div>);
    }
    return (
        <div>
            {allUsers}
        </div>
    );
}

export default Table;
